import ImageSlider from "./ImageSlider";
import './style.css'; // Import your CSS file

const Slideshow = () => {
    const slides = [
        { img: "http://localhost:3000/main_page.png", title: "beach" },
        { url: "http://localhost:3000/main_page2.png", title: "boat" },
        { url: "http://localhost:3000/main_page3.png", title: "forest" },
      
      ];
      const containerStyles = {
        width: "500px",
        height: "280px",
        margin: "0 auto",
      };
      return (
        <div>
          <h1>Hello monsterlessons</h1>
          <div style={containerStyles}>
            <ImageSlider slides={slides} />
          </div>
        </div>
      );
};

export default Slideshow;
